member.remarks:
This is very important property when you are converting HTML document in memory. Specify a BaseURL that is it will convert all relative URLs on that page to absolute URLs.


For example, lets convert HTML string to RTF file.


            If we've specified:


            HtmlConvertOptions opt = new HtmlConvertOptions();
            opt.BaseURL = @"d:\my webs";


            When the component meets 'src="images/asterisk.jpg"' it will try to open it from: "d:\my webs\images\asterisk.jpg"

Using this property you may set custom page numbers as you wish. Use this property together with the ,  and .


             These are special keywords to set the custom page numbering:

{page} - Current page number.
{numpages} - Total pages.

             By default: Page numbers are located at the left-bottom of the page and represent digit(s), for example "1".


             These are samples of using this property:


             HtmlConvertOptions opt = new HtmlConvertOptions();
             opt.PageSetup.PageNumbers.Format = "Page {page} of {numpages}";


             opt.PageSetup.PageNumbers.Format = "This is page number {page}";


             opt.PageSetup.PageNumbers.Format = "Seite {page} von {numpages}";

