example.code:
SautinSoft.HtmlToRtf h = new SautinSoft.HtmlToRtf();
HtmlConvertOptions opt = new HtmlConvertOptions();
opt.PageSetup.PageHeader.FromHtmlURL(@"http://mysite.com/header.htm");
